import React from 'react'

const Thirdbody = () => {
  return (
    <div className='flex'>
        <div style={{backgroundImage:"url(/IMAGES/OBJECTS.png)"}} className="w-full h-[100vh] bg-no-repeat bg-cover"  ></div>
        <div className='w-full h-full'></div>
    </div>
  )
}

export default Thirdbody
